info.description:
#### TypeScript SDK Code Sample

```typescript
import { createClient } from 'liferay-headless-rest-client';
import { getAccountAddress } from 'liferay-headless-rest-client/headless-commerce-admin-account-v1.0';

const client = createClient({
    baseUrl: 'http://localhost:8080',
    headers: {
        Authorization: `Basic ${btoa("test@liferay.com:test")}`,
    },
});

async function main() {
    const { data } = await getAccountAddress({
        client,
        path: {
           id: "20125",
        },
    });

    console.log(data);
}
```
#### Java installation:

Liferay Commerce Admin Account API. A Java client JAR is available for use with the group ID 'com.liferay', artifact ID 'com.liferay.headless.commerce.admin.account.client', and version '4.0.42'.

```gradle
implementation group: "com.liferay", name: "com.liferay.headless.commerce.admin.account.client", version: "latest"
```

Reference: https://mvnrepository.com/artifact/com.liferay/com.liferay.headless.commerce.admin.account.client/latest

x-codeSamples.source:
import { createClient } from 'liferay-headless-rest-client';
import { getAccountAddress } from 'liferay-headless-rest-client/headless-commerce-admin-account-v1.0';

const client = createClient({
    baseUrl: 'http://localhost:8080',
    headers: {
        Authorization: `Basic ${btoa("test@liferay.com:test")}`,
    },
});

async function main() {
    const { data } = await getAccountAddress({
        client,
        path: {
           id: "20125",
        },
    });

    console.log(data);
}

const response = await Liferay.Util.fetch('/o/headless-commerce-admin-account/v1.0/accountAddresses/{id}', {
  method: 'GET',
})

const data = await response.json();

console.log(data);

